CREATE DEFINER=`wom`@`localhost` FUNCTION `next_sub_category_code`(mastercode VARCHAR(10)) RETURNS varchar(10) CHARSET utf8mb4
BEGIN
	SET @nextsubcode = '';
    SELECT CONCAT(mastercode, LPAD(IFNULL(MAX(SUBSTR(cat_code,2,2)) + 1,1),2,'0'))AS next_sub_code 
    INTO @nextsubcode
	FROM wcategory
	WHERE NOT SUBSTR(cat_code,2,2) IN ('00','99')
	AND cat_code LIKE CONCAT(mastercode,'%');

RETURN  @nextsubcode ;
END ;;
