CREATE DEFINER=`wom`@`localhost` PROCEDURE `sp_match_trans_data`(IN t_user VARCHAR(50))
BEGIN
	DECLARE done INT DEFAULT FALSE;
    DECLARE k_name VARCHAR(100);
    DECLARE k_code VARCHAR(3);
    
    DECLARE keyword_cur CURSOR FOR SELECT key_name, key_code FROM wkeyword;
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
    OPEN keyword_cur;
    
    read_loop: LOOP
		FETCH keyword_cur INTO k_name, k_code;
        IF done THEN LEAVE read_loop;
        END IF;
		
        SET @search_keyword = CONCAT('%',k_name,'%'); 
        
        UPDATE wtransaction 
        SET trans_code = k_code,
			trans_status = 1,
            trans_user = t_user
        WHERE REPLACE(trans_desc,' ','') LIKE REPLACE(@search_keyword,' ','')
        AND trans_status IN (0,1);
        
	END LOOP;
    
    CLOSE keyword_cur;
    
END ;;
